            {
                var region = _context.Regions.FirstOrDefault(model => model.name == i.region);
                
                var qualities = _context.Qualities.FirstOrDefault(model => ((model.super == i.super) && (model.value == i.quality)));
                if (qualities == null)
                {
                    Console.WriteLine("TEST: " + i.super + " " + i.quality);
                }
                Hotel hotel = new Hotel();
                if (i.transfer != string.Empty)
                {
                    hotel.transfer = _context.Transfers.FirstOrDefault(model => model.type == i.transfer);
                    hotel.roomService = _context.roomServices.FirstOrDefault(model => model.name == i.roomService);
                    hotel.room = _context.Rooms.FirstOrDefault(model => model.room == i.room);
                }

                hotel.name = i.name;
                hotel.region = region;
                hotel.recomended = i.recomended;
                hotel.quality = qualities;
                hotel.photo = i.photo;
                _context.Hotels.Add(hotel);
            }
            _context.SaveChanges();
        }

        private class HotelData
        {
            public string? photo { get; set; } = string.Empty;
            public string name { get; set; } = string.Empty;
            public string region { get; set; } = string.Empty;
            public int quality { get; set; }
            public bool recomended { get; set; }
            public bool super { get; set; }

            public string? room { get; set; } = string.Empty;
            public string? roomService { get; set; } = string.Empty;
            public string? transfer { get; set; } = string.Empty;
        }
    }
}

